      "description"      : "\u0027천도를 이어받은 천자는 오직 1명뿐!’\n난세를 제압하고 대영왕조를 건설한 천부대제 지마천. 지마천의 뒤를 이을 천자(황제)가 되기 위한 19명의 황자(皇子)들의 피튀기는 ‘황자의 게임’이 시작된다. 황자들 중 막내인 지수룡은 다른 황자들에 비해 집안 배경도 무공도 한참 떨어진다. 천자는 언감생심이요, 죽지 않고 살아남기에만 급급하다. 남다른 총명함을 지녔지만 황궁의 암투에서 살아남기 위해 지수룡은 ‘바보’인 척하며 자신의 정체를 숨긴다. 황궁에서 굴욕의 삶을 살던 어느날 우연히, 지수룡은 ‘천자부소’라는 신기한 상자를 발견한다. ‘천자부소’를 만지는 순간 팔백년 동안 봉인되어 있던 ‘천자의 태부(스승)’이 지수룡의 눈 앞에 나타난다. 태부는 지수룡을 보자 “천자부소를 연 당신은 하늘의 선택을 받은 자다”라며 지수룡의 스승이 되기를 자처한다. 과연 바보로만 살아왔던 지수룡이 ‘천자부소’를 통해 천도를 이어받은 천자(황제)가 되기 위한‘황자의 게임’에서 승리할 수 있을까? 아니면 다른 황자들의 견제 속에 오히려 처참한 최후를 맞이하게 될까?",
