      "description"      : "7일 안에 죽는다! 현호를 찾지 못하면.\n상고비술 청오술에 다루는 청오사.  이들은 하늘을 가르고 땅을 메우는 능력을 지녀 모두의 두려움과 존경을 받아왔다.  이들은 이 비술을 사용해, 인간에게 해를 끼치는 괴물들과 싸워오며 인간 세상의 안정에 기여를 했다. \n100여년 전 이들 중 심일이라는 심씨가문의 수장이 사상 최악의 괴수 기린을 신기(神器) 현호에 봉인하고 세상에 평화를 가져왔다.\n100년 후 이 신기를 탐내는 악당들의 속임수에 부랑청년 엽소가 현호의 봉인을 풀어버리는 바람에 최악의 괴물 기린과 최강의 신기 현호는 세상에 다시 나오게 된다. \n그러나 기린은 엽소의 몸을 숙주삼아 들어가 버리게 되고, 기린이 엽소의 몸을 찢고 나오기까지는 단 7일...\n7일 안에 사상 최고의 보물 \u0027현호\u0027를 찾아서 이 기린을 제거해야 하는데.\n어리버리 주인공 엽소와 함께 하는 초대형 정통무협 판타지가 시작된다.",
