      "description"      : "만물의 영혼을 소환할 수 있는 사람. 예로부터 소환사에 대한 전설이 내려오고 있었는데 흙, 해골, 별, 영혼을 소환할 수 있다는 것이었다. 하지만 전설은 전설일 뿐 세월의 흐름 속에 전설에 관심을 갖거나 믿는 사람은 점점 사라져 갔고, 지금은 아무도 관심조차 없다. 여신 판도라는 만물의 근원이라 여러 소환사들이 판도라를 차지하기 위해 전쟁을 벌여왔다. 결국 소환사 들은 평화협정을 맺고 판도라는 누구도 가질 수 없는 존재로 봉인이 되어 수천 년의 시간동안 깊은 잠에 빠진다. 그러던 어느 날 건이는 자신도 모르게 여신 판도라의 봉인을 풀게 되고 판도라의 꾐에 걸려들어 덜컥 소환사의 계약을 맺게 된다. 판도라와 함께 모험을 떠나는 도중 식물을 소환할 수 있는 하나와 야수를 소환할수 있는 야웅을 만나게 되고, 세 친구는 악마의 소환사 ‘정복자 ’와 맞서기 위해 ‘수호자’어벤져스를 만들어 악에 대항을 하게 되는데... 건이는 과연 최강, 최후의 소환사가 될 수 있을까?",
